import React from "react";
import styled from 'styled-components'

const SidebarParent = styled.div`
  background: #c34a36;
  width: 250px;
  height: 100vh;
`;

class SideNav extends React.Component {
    render(){
        return (
            <>
                <SidebarParent>
                    <SidebarItem>
                        <p>About</p>
                    </SidebarItem>
                    <SidebarItem>
                        <p>Math</p>
                    </SidebarItem>
                    <SidebarItem>
                        <p>Science</p>
                    </SidebarItem>
                    <SidebarItem>
                        <p>Accomplishments</p>
                    </SidebarItem>
                </SidebarParent>
            </>
        );
    }
}

export default Sidebar;
